import React from 'react'
import { View  , TouchableOpacity,StyleSheet,Text
} from 'react-native'


const CustomButton =() =>
{
    return(
        <TouchableOpacity >
            <View StyleS>
                 <Text>dd</Text>
            </View>
        </TouchableOpacity>
        
    )
};

export default CustomButton;

const styles1 = StyleSheet.create({
    container :{
        backgroundColor:'black'

    }


})
